function getAllMyInfo(){var r=$.ajax({url:baseUrl+"/users/",type:"GET",cache:!1});return r}function getAllMyAddress(){var r=$.ajax({url:baseUrl+"/users/addresses",type:"GET"});return r}function getOneAddress(r){var e=$.ajax({url:baseUrl+"/users/addresses/"+r,type:"GET"});return e}function deleteOneAddress(r){var e=$.ajax({url:baseUrl+"/users/addresses/"+r,type:"DELETE"});return e}function getSchoolList(r){r||(r=currentCityId);var e=$.ajax({url:baseUrl+"/schools/"+r,type:"GET"});return e}function getDormList(r){var e=$.ajax({url:baseUrl+"/schools/"+r+"/dorms",type:"GET"});return e}function addAddress(r){var e=$.ajax({url:baseUrl+"/users/addresses",type:"POST",data:r});return e}function editAddress(r,e){var a=$.ajax({url:baseUrl+"/users/addresses/"+r,type:"PUT",data:e});return a}function editSex(r){var e=$.ajax({url:baseUrl+"/users/profile",data:{type:3,sex:r},type:"PUT"});return e}function editUsername(r){var e=$.ajax({url:baseUrl+"/users/profile",data:{type:2,username:r},type:"PUT"});return e}function editPhoneNum(r,e){var a=$.ajax({url:baseUrl+"/users/profile",data:{type:5,phone:r,verfityCode:e},type:"PUT"});return a}function getHistory(r,e){var a=$.ajax({url:baseUrl+"/histories",type:"POST",data:{page:r,pageSize:e}});return a}function getOrderList(r,e){var a=$.ajax({url:baseUrl+"/orders/list",type:"POST",data:{page:r,orderStatus:e}});return a}function getScore(){var r=$.ajax({url:baseUrl+"/users/profiles/infos",cache:!1});return r}function scoreExchange(r){var e=$.ajax({url:baseUrl+"/users/profiles/scores/exchange",type:"POST",data:{score:r}});return e}function scoreList(r){var e=$.ajax({url:baseUrl+"/users/profiles/scores/records/"+r,type:"GET"});return e}function moneyRecordList(r){var e=$.ajax({url:baseUrl+"/users/profiles/moneys/records/"+r,type:"GET"});return e}function moneyRecordDetail(r){var e=$.ajax({url:baseUrl+"/users/profiles/moneys/records/jump/"+r,type:"GET"});return e}function bookDetail(r){var e=$.ajax({url:baseUrl+"/books/"+r,type:"GET"});return e}function cartList(){var r=$.ajax({url:baseUrl+"/shopping_carts",type:"POST",data:{page:"1",pageSize:"1000"}});return r}function addToCart(r){var e=$.ajax({url:baseUrl+"/shopping_cart",type:"POST",data:{relationId:r,type:"0",num:"1",featureId:"0",cityId:currentCityId}});return e}function deleteFromCart(r){var e=$.ajax({url:baseUrl+"/shopping_carts/"+r,type:"DELETE"});return e}function createOrder(r,e,a){var t=$.ajax({url:baseUrl+"/orders",type:"POST",data:{ids:r,type:a,num:e,featureId:"0",cityId:currentCityId}});return t}function orderConfirm(r){var e=$.ajax({url:baseUrl+"/orders/confirm/"+r+"/"+currentCityId,type:"GET"});return e}function orderDetail(r){var e=$.ajax({url:baseUrl+"/orders/"+r,type:"GET"});return e}function wechatPay(r,e){var a=$.ajax({url:baseUrl+"/trade/wxPayParams",type:"POST",data:{tradeNo:r,payType:"0",change:e}});return a}function changeMessage(r,e){var a=$.ajax({url:baseUrl+"/orders/"+r+"/message",type:"PUT",data:{message:e}});return a}function editOrderPlace(r,e){var a=$.ajax({url:baseUrl+"/orders/"+r+"/address/"+e,type:"PUT"});return a}function cancelOrder(r){var e=$.ajax({url:baseUrl+"/orders/"+r+"/close",type:"PUT"});return e}function expressDetail(r,e,a,t){var s=$.ajax({url:baseUrl+"/orders/"+r+"/express",type:"POST",data:{company:e,isYunExpress:a,expressNumber:t}});return s}function applyRefund(r){var e=$.ajax({url:baseUrl+"/orders/"+r+"/cancel",type:"PUT"});return e}function changePay(r,e){var a=$.ajax({url:baseUrl+"/changePay/success",type:"POSt",data:{change:100*e,tradeNo:r}});return a}